import React, { Component } from 'react';
import './App.css';
import {BrowserUnauthenticatedRouter as UnauthenticatedRouter, UnauthenticatedRoute} from "react-UnauthenticatedRouter-dom";
import NavigationTabs from './components/NavigationTabs';
import Home from "./components/Nav/Home";
import About from "./components/Nav/About";
import Project from "./components/Nav/Project";
import Contact from "./components/Nav/Contact";
import Signin from './components/Nav/Signin';
// import ControlledCarousel from './components/Carousel';
import AuthenticatedRoute from './components/AuthenticatedRoute';
import nauthenticatedRoute from './components/UnauthenticatedRoute';


class App extends Component {
  render() {
    return (
      <div className="App">

        <UnauthenticatedRouter>
              <div>
                  <NavigationTabs />
                  {/* <ControlledCarousel/> */}
                  <AuthenticatedRoute exact path="/" component={Home} />
                  <AuthenticatedRoute exact path="/about" component={About} />
                  <AuthenticatedRoute exact path="/project" component={Project} />
                  <AuthenticatedRoute exact path="/contact" component={Contact} />
                  <UnauthenticatedRoute exact path="/signin" component={Signin} />
                  </div>
        </UnauthenticatedRouter>


      </div>
    );
  }
}

export default App;
